import React from "react";
import "./home.css";
import { Search } from "react-bootstrap-icons";
const Home = () => {
  return (
    <div className="body">
      <div className="main">
        <img
          src="https://www.okayplayer.com/media-library/photo-by-jakub-dziubak-for-unsplash.jpg?id=46471783&width=1245&height=700&quality=90&coordinates=0%2C0%2C0%2C158"
          alt="err"
          style={{
            width: "1200px",
            height: "600px",
          }}
        ></img>
        <input
          type="text"
          placeholder="Search"
          style={{
            width: "420px",
            height: "45px",
            position: "absolute",
            margin: "20px",
            marginLeft: "400px",
            border: "1px solid black",
            borderRadius: "8px",
          }}
        ></input>
        <button
          style={{
            position: "absolute",
            marginLeft: "823px",
            height: "45px",
            width: "80px",
            border: "1px solid black",
            borderRadius: "8px",
          }}
        >
          <Search size={25} />
        </button>
      </div>
      <div>
        <img src="https://www.nicepng.com/png/detail/122-1221053_whiskey-glass-png-rum-in-glass-png.png" alt="err"></img>
        <div>
        <h4>About Us</h4>
        <div>
          <h6>Best Ingredients</h6>
          <p></p>
          <h6>Farming Practices</h6>
          <p></p>
        </div>
        <div>
          <h6>Our Process</h6>
          <p></p>
        </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
